module("SetMaterialValueCommand"),test("Test for SetMaterialValueCommand (Undo and Redo)",function(){var e=new Editor,a=aBox(),t=new AddObjectCommand(a);t.updatable=!1,e.execute(t);var o={uuid:[THREE.Math.generateUUID(),THREE.Math.generateUUID(),THREE.Math.generateUUID()],name:["Alpha","Bravo","Charlie"],shininess:[11.1,22.2,33.3],vertexColors:["No","Face","Vertex"],bumpScale:[1.1,2.2,3.3],reflectivity:[-1.3,2.1,5],aoMapIntensity:[.1,.4,.7],side:["Front","Back","Double"],shading:["No","Flat","Smooth"],blending:["No","Normal","Additive"],opacity:[.2,.5,.8],alphaTest:[.1,.6,.9],wireframeLinewidth:[1.2,3.4,5.6]},l=Object.keys(o);l.map(function(t){o[t].map(function(o){var l=new SetMaterialValueCommand(a,t,o);l.updatable=!1,e.execute(l)});var l=o[t].length;ok(a.material[t]==o[t][l-1],"OK, "+t+" was set correctly to the last value (expected: '"+o[t][l-1]+"', actual: '"+a.material[t]+"')"),e.undo(),ok(a.material[t]==o[t][l-2],"OK, "+t+" was set correctly to the second to the last value after undo (expected: '"+o[t][l-2]+"', actual: '"+a.material[t]+"')"),e.redo(),ok(a.material[t]==o[t][l-1],"OK, "+t+" was set correctly to the last value again after redo (expected: '"+o[t][l-1]+"', actual: '"+a.material[t]+"')")})});